import Link from 'next/link'
import Layout from '../components/Layout';

const Index = () => (
    <Layout>
        <div>내 정보 관리</div>
        <h2>
            <Link href="/mycert">
                <a style={{background: 'black', color: 'white'}}>인증서 관리</a>
            </Link>
            <Link href="/cert">
                <a>사용자 인증</a>
            </Link>
        </h2>
    </Layout>
);

export default Index;
